import React from "react";
import styled from "styled-components";

const FollowIcon = (props) =>{
    return(
        <Wrapper>
            <a href="https://www.google.com">
                <i className={props.icon} />
            </a>
        </Wrapper>
    )
}

export {FollowIcon};

const Wrapper = styled.div`
    display: flex;
    align-items: center;
    justify-content: center;
    width: 6em;
    height: 6em;
    border:2px solid black
`;
